import style from "./Courses.module.css";
import { Link } from "react-router-dom";

function coursesMenu(props) {
  console.log(props);

  if (props.userCourses !== "") {
    return (
      <div className={style.container}>
        <div>
          <div className={style.introduction}>
            {props.username + ", great day to learn something new!"}
            <div className={style.subIntroduction}>
              Choose your first course
            </div>
          </div>
        </div>
        <div></div>
        <div>
          {props.userCourses.map((p) => (
            <div key={p._id} className={style.courseName}>
              <button
                onClick={(p) => {
                  console.log("=================");
                  console.log(p);
                  console.log("=================");
                  props.setCurrentCourseName(p);
                }}
              >
                <Link to={"/courses/lessons"}>
                  <div className={style.content}>{p.courseName}</div>
                </Link>
              </button>
            </div>
          ))}
        </div>
        <div className={style.courseName}>
          <div className={style.content}>Coming soon...</div>
        </div>
      </div>
    );
  } else {
    return <div>Something went wrong</div>;
  }
}
export default coursesMenu;
